import classes from './Auth.module.css';
import { useState } from 'react';



const Auth = () => {
  const [details,setDetails] = useState({email:"",password:""})


  return (
    <main className={classes.auth}>
      <section>
        <form>
          <div className={classes.control}>
            <label htmlFor='email'>Email</label>
            <input type='email' id='email' onChange={(e) => setDetails({email:e.target.value,password:details.password})}/>
          </div>
          <div className={classes.control}>
            <label htmlFor='password'>Password</label>
            <input type='password' id='password' onChange={(e) => setDetails({email:details.email,password:e.target.value})}/>
          </div>
          <button >Login</button>
        </form>
      </section>
    </main>
  );
};

export default Auth;
